  .item-card {
    width: 69px;
    height: 83px;
    line-height: 83px;
    font-size: 25px;
    color: #e4a41f;
    border-radius: 7px;
    text-align: center;
  }
  .item-checked-in {
    display: flex;
    align-items: center;
    justify-content: center;
    background-color: #aefe8b;
    & + .item-date {
      color: #787f8c;
    }
    img {
      width: 30px;
      height: 20px;
    }
  }
  .item-today {
    background-color: #fcf3b2;
    border: solid 3px #e9a415;
    & + .item-date {
      color: #787f8c;
    }
  }
  .item-point {
    background-color: #fdf2db;
    & + .item-date {
      color: #abb1bb;
    }
  }
  .item-expires {
    display: flex;
    align-items: center;
    justify-content: center;
    background-color: #c5c5c5;
    & + .item-date {
      color: #787f8c;
    }
    img {
      width: 22px;
      height: 21px;
    }
  }
  .item-date {
    margin-top: 4px;
    font-size: 19px;
  }
  .btn-check-in {
    width: 222px;
    height: 56px;
    font-size: 25px;
    background-color: #ff4565;
    border-radius: 7px;
    align-self: center;
    border: 0;
    &.checked {
      background-color: #828282;
    }
  }

  .van-toast {
    width: 270px;
    height: 270px;
    padding: 40px;
    font-size: 33px;
    .van-toast__icon {
      font-size: 110px;
    }
    .van-toast__text {
      margin-top: 15px;
      line-height: 1.5;
    }
  }
}

